import React from 'react';
import { Link } from 'react-router-dom';

const Login = () => {
    return (
        <div>
            <Link to="/home" className="mt-5"><img src="https://iili.io/27JGwB.png" style={{width:200}} className="d-inline-block align-top"alt=""/></Link>
            <h1>This is login</h1>
        </div>
    );
};

export default Login;
